Parte de nuestra rutina es poner el calendario 📅, sin embargo nuestro calendario, ha sufrido modificaciones debido a los nuevos aprendizajes de Iñaki ❤️
.
Mis últimos posts también han sufrido un pequeño cambio, qué tal vez no ha sido tan notorio, pero existe! — el idioma de las actividades—
.
A pesar de que en casa hemos hablado inglés con Iñaki durante toda su vida, jamás lo había visto tan  interesado en el idioma como ahora 🤓. El escuchar a su maestra (que adora!), y sus amigos lo ha hecho activar ese botón y parece imparable 🙊🤣🤣
.
Todo el tiempo me pregunta cómo se dicen ciertas cosas en inglés, me canta en inglés, me pide que le lea libros en inglés, incluso cuando yo estoy leyendo un libro me pide que lo haga en voz alta (sabe que leo en inglés) 💫, esto me ha dado la pauta para que las actividades estén enfocadas a este “nuevo idioma” 🤓
.
El día de hoy tomamos un muy querido cuento 📖 “The very hungry caterpillar” 🐛 de Eric Carle y lo convertimos en nuestra inspiración para aprender los días de la semana, además que se convertirá en parte de nuestra rutina repasarlos todas las mañanas. ❤️🦋🔆
